import React, { Component } from 'react';
import back1 from '../back1.jpg';
import back2 from '../back2.jpg';

class Header extends Component {

    render () {
      return (
  <header>
    <div className="position-relative overflow-hidden p-3 p-md-5 m-md-3 text-center bg-light img-fluid bg-custom" style={{ 
	    background: `url(${back2})`,
	    backgroundPosition: 'center',
            backgroundSize: 'cover',
            backgroundRepeat: 'no-repeat',
            width: '100vw',
            height: '100vh'
    }}>
      <div className="col-md-5 p-lg-5 mx-auto my-5">
        <h1 className="display-4 font-weight-normal">Punny headline</h1>
        <p className="lead font-weight-normal">And an even wittier subheading to boot. Jumpstart your marketing efforts with this example based on Apple's marketing pages.</p>
        <a className="btn btn-outline-secondary" href="#">Coming soon</a>
      </div>
      <div className="product-device shadow-sm d-none d-md-block"></div>
      <div className="product-device product-device-2 shadow-sm d-none d-md-block"></div>
    </div>
  </header>
        );
    }
}

export default Header;
